import React, { Component } from 'react';
import './index.css';

import Icons from './Layout/Icons/IconContainer';
import CalcApp from './Layout/ReactProjects/Calculator';
import TodoApp from './Layout/ReactProjects/Todo';
import Signature from './Layout/Signature';
import Logo from './Layout/Logo';

{/* <i class="fas fa-user-clock"></i> */}

export default 
class App extends Component {
  state = {
    pomodoro: false
  }

  render() {
    return (
      <div style = { desktopContainer }>
        <div style = { pageLeftContent }>
          <div style = { desktopIconStyles }>
            <Icons />
          </div>
          <div>
            <CalcApp />
            <TodoApp />
          </div>
        </div>
        <div style = { logoContainer }>
          <div style = { logoImg }>
            <Logo />
          </div>
          <div style = { logoText }>
            <Signature />
          </div>
        </div>
      </div>
    );
  }
}

const desktopContainer = {
  height: '100vh',
  width: '100vw',
  background: 'linear-gradient(145deg, #090a0a 45%, #151617 75%)',
  color: 'white',
  display: 'flex',
  justifyContent: 'space-between',
  border: '2px solid green'
}

const pageLeftContent = {
  display: 'flex',
  flexDirection: 'column',
  width: '50%',
  paddingLeft: '5%',
  justifyContent: 'space-between',
  border: '2px solid blue'
}

const desktopIconStyles = {
  display: 'flex',
  justifyContent: 'space-between',
  width: '100%',
  padding: '5%',
  position: 'relative',
  border: '2px solid purple'
}

const logoContainer = {
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'center',
  alignItems: 'center',
  border: '2px solid red',
  width: '50%'
}

const logoImg = {
  height: '75vh',
}

const logoText = {
  width: '50%'
}
